(6, 'TOR-2112201900001', '1.1.1. Lokakarya bagi pegawai puskesmas dan kader desa sehat jiwa 1 : Asesment dasar, Deteksi dini, dan Sistem Rujukan', 'somai', 'makan', 'kA erik', 0, '2019-12-13', '2019-12-23', 'BAPELKES', 'Dolo', 'Karawana', 'Rp. 30.000.000', 'baju\r\nsound sistem\r\nrono\r\ndou', 'sskdbfksdbfsdfbkdbfjsdf', '', 'Revisi', 'TIDAK ADA RB'),
(7, 'TOR-2112201900002', '2.1.2. Memfasilitasi tim manajemen kebencanaan desa dalam menyusun manajemen kedaruratan bencana berbasis kesehatan mental', 'chvbxncvdjncjdncja', 'jdcbndsabcnc', 'hcbvnsdcbjvd', 0, '2019-10-12', '2019-12-10', 'bncdbjdbcj', 'Sigi Biromaru', 'Jono Oge', 'Rp. 4.444.444', 'hnssnbs', 'jnsnsabsa', '', 'Revisi', 'BELUM ADA RB'),
(8, 'TOR-2112201900003', '1.3.2. Melakukan asesmment kondisi kesehatan mental penyintas yang tinggal di hunian sementara dan di 4 desa', 'Gempa bumi berkekuatan 7,4 SR mengguncang daerah Palu, Sigi, Donggala dan Parigi Moutong, Indonesia, pada tanggal 28 September 2018 pukul 18.02 WITA. Gempa bumi ini memicu terjadinya tsunami dan likuifaksi di beberapa bagian dari wilayah Palu, Sigi dan Donggala. \r\nAda berbagai risiko yang mempengaruhi kesehatan mental seseorang ketika mengalami bencana seperti gempa bumi. Peristiwa ini dapat menjadi sumber potensial stress dan trauma. WHO menyimpulkan bahwa 4% dari penyintas dapat mengalami gangguan mental yang parah, dan penyintas yang memiliki gangguan mental ringan dapat menjadi parah karena tidak ada layanan dan kebijakan kesehatan mental yang mendukung perawatan kesehatan mental. Bencana Palu, Sigi, dan Donggala menciptakan kerusakan fisik (baik infrastruktur maupun kesehatan fisik penyintas) dan kerusakan mental. Namun, perawatan kesehatan mental cenderung diabaikan, bahkan tidak menjadi referensi untuk persiapan langkah-langkah strategis sebagai upaya pemulihan dan pengurangan risiko bencana.\r\nPada kegiatan ini, kami melakukan penilaian kondisi kesehatan mental para penyintas yang tinggal di T-Shelter dan di 4 desa. Sebelum pelaksanaan program, akan ada penilaian kondisi kesehatan mental penyintas yang selamat di tempat penampungan sementara dan penduduk yang tinggal di 4 desa intervensi. Penilaian ini bertujuan untuk memperoleh data awal tentang kondisi kesehatan mental, memetakan siapa yang telah mengalami masalah kesehatan mental sehingga mereka perlu mendapatkan pemulihan dan siapa yang rentan untuk mengalaminya, sehingga mereka perlu mendapatkan upaya pencegahan agar tidak mengalami gangguan kesehatan mental. Data awal ini juga dapat digunakan sebagai dasar dalam mengukur keberhasilan implementasi program. Pada akhir implementasi program, data akhir akan dikumpulkan untuk melihat perubahan kondisi kesehatan mental dan efektivitas implementasi program.', 'Tersedianya data awal tentang kondisi kesehatan mental para penyintas yang tinggal di T-Shelter dan di 4 desa intervensi.', '-', 0, '2019-11-16', '2019-12-10', '500 orang yang terdiri dari para penyintas yang tinggal di T-Shelter dan di 4 desa intervensi.', 'Dolo', 'Karawana', 'Rp. 1.750.000,00', '500 Kuesioner dan ATK', 'Demikian TOR Conducting Assessment of Mental Health Condition of Survivors Living in T-Shelter and in 4 Villages ini dibuat. Atas kerjasama dan kolaborasi kebaikan, kami mengucapkan terima kasih.', 'TOR-2112201900003.pdf', 'Proses', ''),
(9, 'TOR-2112201900004', '1.1.1. Lokakarya bagi pegawai puskesmas dan kader desa sehat jiwa 1 : Asesment dasar, Deteksi dini, dan Sistem Rujukan', 'Kondisi Palu, Sigi dan Donggala pasca bencana gempa bumi 7,4 SR, tsunami dan likuifaksi pada tanggal 28 September 2018 telah memasuki tahap rehabilitasi dan rekonstruksi. Untuk mendukung tahapan tersebut perlu dilakukan pendampingan program  Disaster Risk Reduction (DRR) atau Pengurangan Risiko Bencana (PRB) yang akan menjadi pondasi untuk meningkatkan ketangguhan psikologis dan sosial masyarakat melalui layanan kesehatan jiwa primer berbasis komunitas yang dilaksanakan dengan melibatkan masyarakat dan Puskesmas. \r\n	Pelaksanaan program Disaster Risk Reduction (DRR) diharapkan mampu untuk membantu pemulihan kesehatan jiwa pasca bencana dan membantu sistem antisipasi dini kesehatan jiwa sebagai bagian dari pengurangan risiko bencana melalui pembentukan layanan kesehatan jiwa primer berbasis komunitas yang dilaksanakan dengan melibatkan masyarakat dan Puskesmas di daerah terdampak.\r\n	Tenaga kesehatan jiwa di Puskesmas maupun kader desa membutuhkan pelatihan tentang penyelenggaraan pelayanan kesehatan jiwa dasar. Oleh karena itu kami akan menyelenggarakan workshop tentang “Mechanism for Mental Health Services, Basic Assessment, Early Detection, and Referral Systems” bagi tenaga kesehatan jiwa di Puskesmas dan kader desa.', 'Meningkatnya kemampuan tenaga kesehatan di dua Puskesmas serta kader kesehatan jiwa di empat desa tentang mekanisme pelayanan kesehatan mental.', '1)	2 orang staf ahli dan psikolog dari Center for Public Mental Health (CPMH), Psychology Faculty, UGM\r\n2)	1 orang psikolog dari Palu', 0, '2019-12-13', '2019-12-04', 'BAPELKES', 'Sigi Biromaru', 'Bora', 'Rp. 58.010.000', '- Equipment of Participants & Stationary\r\n- Basic Psychosocial Module', 'Demikian TOR Workshop for the Primary health care Officers and Mental Health Village 1 : Basic Assessment, Early Detection, and Referral System ini dibuat.  \r\nAtas kerja sama & kolaborasi kebaikan, kami mengucapkan terima kasih.', 'TOR-2112201900004.pdf', 'Di Setujui', ''),
(10, 'TOR-2112201900005', '1.1.2. Lokakarya bagi pegawai puskesmas dan kader desa sehat jiwa 2 : Konseling dasar', 'Kondisi Palu, Sigi dan Donggala pasca bencana gempa bumi 7,4 SR, tsunami dan likuifaksi pada tanggal 28 September 2018 telah memasuki tahap rehabilitasi dan rekonstruksi. Untuk mendukung tahapan tersebut perlu dilakukan pendampingan program  Disaster Risk Reduction (DRR) atau Pengurangan Risiko Bencana (PRB) yang akan menjadi pondasi untuk meningkatkan ketangguhan psikologis dan sosial masyarakat melalui layanan kesehatan jiwa primer berbasis komunitas yang dilaksanakan dengan melibatkan masyarakat dan Puskesmas. \r\n	Pelaksanaan program Disaster Risk Reduction (DRR) diharapkan mampu untuk membantu pemulihan kesehatan jiwa pasca bencana dan membantu sistem antisipasi dini kesehatan jiwa sebagai bagian dari pengurangan risiko bencana melalui pembentukan layanan kesehatan jiwa primer berbasis komunitas yang dilaksanakan dengan melibatkan masyarakat dan Puskesmas di daerah terdampak.\r\n	Tenaga kesehatan jiwa di Puskesmas maupun kader desa membutuhkan pelatihan tentang penyelenggaraan pelayanan kesehatan jiwa dasar. Oleh karena itu kami akan menyelenggarakan workshop tentang “Basic Counseling” bagi tenaga kesehatan jiwa di Puskesmas dan kader desa.', 'Meningkatnya kemampuan tenaga kesehatan di dua Puskesmas serta kader kesehatan jiwa di empat desa tentang mekanisme pelayanan kesehatan mental.', '2 orang Psikolog dari Palu', 0, '2019-11-23', '2019-12-11', 'BAPELKES', 'Sigi Biromaru', 'Jono Oge', 'Rp. 33.560.000', '- Equipment of Participants & Stationary\r\n- Psychosocial Module of Basic Counseling & Resilience', 'Demikian TOR Workshop for the Primary health care Officers and Mental Health Village 2 : Basic Counseling ini dibuat.\r\nAtas kerja sama & kolaborasi kebaikan, kami mengucapkan terima kasih.', 'TOR-2112201900005.pdf', 'Proses', ''),
